import { Component } from '@angular/core';

@Component({
  selector: 'app-padre',
  templateUrl: './padre.component.html',
  styleUrls: ['./padre.component.css']
})

export class PadreComponent {
  nombrePadre:string = 'Pablo';
  apPaternoPadre:string = 'Vargas';
  apMaternoPadre:string = 'Morales';
}
<div class="datosPadre">
  <h1>Datos del PADRE</h1>
  <span>Nombre:</span><b>{{ nombrePadre }}</b><br/>
  <span>Apellido Paterno:</span><b>{{ apPaternoPadre }}</b><br/>
  <span>Apellido Materno:</span><b>{{ apMaternoPadre }}</b><br/>
</div>



